# Locked by Noctura (AES-GCM)
import base64, getpass
from cryptography.hazmat.primitives.kdf.pbkdf2 import PBKDF2HMAC
from cryptography.hazmat.primitives import hashes
from cryptography.hazmat.primitives.ciphers.aead import AESGCM
import sys

payload = ""

def derive_key(pw: bytes, salt: bytes):
    kdf = PBKDF2HMAC(algorithm=hashes.SHA256(), length=32, salt=salt, iterations=200000)
    return kdf.derive(pw)

def decrypt(pw_str):
    raw = base64.b64decode(payload)
    salt = raw[:16]
    nonce = raw[16:28]
    ct = raw[28:]
    key = derive_key(pw_str.encode('utf-8'), salt)
    aesgcm = AESGCM(key)
    return aesgcm.decrypt(nonce, ct, associated_data=None)

try:
    pw = getpass.getpass("Password to decrypt: ")
    code = decrypt(pw).decode("utf-8")
    exec(compile(code, "<decrypted>", "exec"), globals())
except Exception as e:
    print("Decryption failed:", e)
    sys.exit(2)
